import { Container, Input, Table } from "reactstrap";
import Header from "../Nav/Header";
import Sidebar from "../Sidebar/Sidebar";
import Button from "@material-ui/core/Button";
import "../../css/Notification.css";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import notiAPI from "../../api/notiAPI";

function Notification() {
  const [all, setAll] = useState([]);
  useEffect(() => {
    async function fetListNoti() {
      try {
        const res = await notiAPI.getAll();
        setAll(res.data);
      } catch (error) {
        console.log(error);
      }
    }
    fetListNoti();
  }, []);
  
  return (
    <div>
      <Sidebar />
      <div className="main-panel">
        <Header />
        <Container fluid={true}>
          <div>
            <p style={{ float: "left", fontSize: "18px", marginTop: "20px" }}>
              Notification management
            </p>
            <Button
              style={{ position: "absolute", right: 0, marginTop: "20px" }}
              color="primary"
            >
              Mark all announcements as read
            </Button>
          </div>
          <div>
            <Input style={{ width: 160 }} type="select" name="filter-type">
              <option>-Filter by type-</option>
              <option>2</option>
              <option>3</option>
              <option>4</option>
              <option>5</option>
            </Input>
            <Input style={{ width: 160 }} type="select" name="filter-status">
              <option>-Filter by status-</option>
              <option>2</option>
              <option>3</option>
              <option>4</option>
              <option>5</option>
            </Input>
          </div>
          <Table>
            <thead>
              <tr></tr>
            </thead>
            <tbody>
              <tr>
                <td>
                  <p
                    style={{
                      position: "fix",
                      left: 10,
                      fontWeight: "bold",
                      float: "left",
                    }}
                  >
                    {all[0].content}
                  </p>
                  <br />
                  <p
                    style={{
                      position: "absolute",
                      float: "left",
                      marginLeft: "20px",
                      left: 0,
                    }}
                  >
                    {all[0].title}
                  </p>
                  <br />
                  <div
                    style={{
                      position: "absolute",
                      float: "left",
                      marginLeft: "20px",
                      left: 0,
                    }}
                  >
                    <Link to="/">View detail</Link>
                  </div>
                </td>
                <td>
                  <div style={{ position: "absolute", right: 10 }}>
                    13/03/2021 14:20:34
                  </div>
                </td>
              </tr>
              <tr>
                <td>
                  <p
                    style={{
                      position: "fix",
                      left: 0,
                      fontWeight: "bold",
                      float: "left",
                    }}
                  >
                    Duc vua tao mot hop dong
                  </p>

                  <br />

                  <p
                    style={{
                      position: "absolute",
                      float: "left",
                      marginLeft: "20px",
                      left: 0,
                    }}
                  >
                    Duc vua tao 1 hop dong. Document ID: 12331
                  </p>
                  <br />
                  <div
                    style={{
                      position: "absolute",
                      float: "left",
                      marginLeft: "20px",
                      left: 0,
                    }}
                  >
                    <Link to="/">View detail</Link>
                  </div>
                </td>
                <td>
                  <div style={{ position: "absolute", right: 10 }}>
                    13/03/2021 14:20:34
                  </div>
                </td>
              </tr>
            </tbody>
          </Table>
        </Container>
      </div>
    </div>
  );
}
export default Notification;
